package br.com.restaurante.model;import java.util.List;@SuppressWarnings("serial")public class MedidaModel extends BaseModel implements CrudModel<MedidaModel>{	private Long idExterno;	private String descricao;		private List<MedidaUnidadeMedidaModel> unidadesMedidas;		private List<MedidaModel> historico;	public Long getIdExterno() {		return idExterno;	}	public void setIdExterno(Long idExterno) {		this.idExterno = idExterno;	}	public String getDescricao() {		return descricao;	}	public void setDescricao(String descricao) {		this.descricao = descricao;	}	public List<MedidaUnidadeMedidaModel> getUnidadesMedidas() {		return unidadesMedidas;	}	public void setUnidadesMedidas(List<MedidaUnidadeMedidaModel> unidadesMedidas) {		this.unidadesMedidas = unidadesMedidas;	}	public List<MedidaModel> getHistorico() {		return historico;	}	public void setHistorico(List<MedidaModel> historico) {		this.historico = historico;	}}